import { useState } from "react";

import Button from "../utils/components/Button";
import LeftToRightComponents from "../utils/components/LeftToRightComponents";

function Home() {
	const [next, bindNext] = useState(() => () => {});
	const [previous, bindPrevious] = useState(() => () => {});

	return (
		<div style={{ textAlign: "center" }}>
			<Button onClick={previous} style={{ marginRight: "15px" }}>
				Précédent
			</Button>
			<Button onClick={next} style={{ marginLeft: "15px" }}>
				Suivant
			</Button>

			<div
				style={{
					height: "50vh",
					justifyContent: "center",
					display: "flex",
					flexDirection: "row",
					alignItems: "center",
					border: '1px solid red'
				}}>
				<LeftToRightComponents bindNext={bindNext} bindPrevious={bindPrevious} durationInMs={200}>
					<>Page 1</>
					<>Page 2</>
					<>Page 3</>
				</LeftToRightComponents>
			</div>
		</div>
	);
}

export default Home;
